import { Link } from "react-router-dom";

function HomePage() {
  return (
    <>
      <h1>내 홈페이지</h1>
      <p><Link href="/products">여기</Link>로 이동해서 제품 목록을 확인할 수 있습니다.</p>
    </>
  );
}
export default HomePage;
